import React, { Component } from "react";
import { Route, Switch, Routes } from "react-router-dom";
import Login from "./Login";

export default class App extends Component {
  render() {
    return (
      <>
        <Switch>
          <Routes>
            <Route path="/" component={Login} exact />
          </Routes>
        </Switch>
      </>
    );
  }
}
